import React from "react";
import hoc from "./hoc";
class FilterProductsClothing extends React.Component{
    render(){
       const {result,handleChange,handleSearch,storename}=this.props
        return(
            <div>
                <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <a className="navbar-brand" href="#">Welcome User </a>
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                  <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
                  <div class="navbar-nav">
                    <a class="nav-item nav-link " href="add.html" ><FilterProductsClothing>Coth</FilterProductsClothing></a>
                    <a class="nav-item nav-link " href="add.html" >Cart</a>
                    
                  </div>
                </div>
              </nav>

            
            
           <form>
           {/* <button>Click here to shop cloths</button>
            <button>Click here to shop Electronic gadgets</button> */}
            <input type='text' placeholder="enter product name" onChange={(e)=>handleChange(e)}></input>
            <button onClick={(e)=>handleSearch(e)}>search</button>
        </form>
        {
                    result.map((item)=>(
                        <div>
                            <h2>{item.pName}</h2>
                            <p>Price:{item.price}</p>
                            <p>Manufacturer:{item.manufacturer}</p>
                        </div>
                    ))
                }
        </div>
        )

    }
}
export default hoc(FilterProductsClothing)
